const Mock = require('mockjs');
let articleList = [{
    id: 1,
    title: 'df',
    author: 'df',
    job: 'Web前端'
},{
    id: 2,
    title: 'fd',
    author: 'fd',
    job: 'Java工程师'
}]

export default {
    'get|/article/List':  option => {
        return {
            code: 200,
            msg: 'success',
            data: articleList
        };
    }
}
